class MatrixModifierApp(QMainWindow):
    def __init__(self2):
        super().__init__()
        print(global_variable)
        print(global_variable_relay)
        self2.central_widget = QWidget(self2)
        self2.setCentralWidget(self2.central_widget)
        self2.resize(470, 370)
        layout = QVBoxLayout(self2.central_widget)
        self2.tab_widget = QTabWidget(self2)

        

        # First tab for matrix preview
        self2.tab_preview = QWidget()
        
        
        from PyQt5.QtWidgets import QTableWidget
        
        self2.table_widget = QTableWidget(self2.tab_preview)
        self2.tab_widget.addTab(self2.tab_preview, "Preview")
        self2.tab_preview.resize(300,300)
        layout.addWidget(self2.tab_widget)

        # Second tab for separator changing
        self2.tab_change_separator = QWidget()
        layout_change_separator = QVBoxLayout(self2.tab_change_separator)

        # Upload button
        #self2.upload_button = QPushButton('Upload', self2.tab_change_separator)
        #self2.upload_button.clicked.connect(self2.upload_and_show_matrix)
        #layout_change_separator.addWidget(self2.upload_button)

        # Transpose button
        self2.transpose_button = QPushButton('Transpose', self2.tab_change_separator)
        self2.transpose_button.clicked.connect(self2.transpose_matrix)
        layout_change_separator.addWidget(self2.transpose_button)

        # Remove Rows button
        self2.remove_rows_button = QPushButton('Remove Rows', self2.tab_change_separator)
        self2.remove_rows_button.clicked.connect(self2.remove_rows)
        layout_change_separator.addWidget(self2.remove_rows_button)

        # Remove Columns button
        self2.remove_columns_button = QPushButton('Remove Columns', self2.tab_change_separator)
        self2.remove_columns_button.clicked.connect(self2.remove_columns)
        layout_change_separator.addWidget(self2.remove_columns_button)

        # Save Matrix button
        self2.save_matrix_button = QPushButton('Save Matrix', self2.tab_change_separator)
        self2.save_matrix_button.clicked.connect(self2.save_matrix)
        layout_change_separator.addWidget(self2.save_matrix_button)

        self2.tab_widget.addTab(self2.tab_change_separator, "tab")

        self2.matrix_data = None
        self2.displayed_matrix = None
        self2.separator = ','  # Default separator
        self2.has_header = True  # Default assumption is that the dataset has a header
        self2.max_display_rows = 10  # Maximum number of rows to display
        self2.max_display_cols = 10  # Maximum number of columns to display
        
        self2.upload_and_show_matrix()

    def upload_and_show_matrix(self2):
        # Map separators to display names
        separator_names = {',': 'Comma', ';': 'Semicolon', '\t': 'Tab', ' ': 'Space'}

        # Ask the user for the separator
        separators = [',', ';', '\t', ' ']
        
        from PyQt5.QtWidgets import QInputDialog
        
        separator, ok = QInputDialog.getItem(self2, 'Select Separator', 'Select the separator:', [separator_names[s] for s in separators], 0, False)
        if not ok:
            return

        # Map the selected display name back to the actual separator
        self2.separator = [k for k, v in separator_names.items() if v == separator][0]

        # Ask the user whether the dataset has a header
        has_header, ok = QInputDialog.getItem(self2, 'Header', 'Does the dataset have a header?', ['Yes', 'No'], 0, False)
        if not ok:
            return

        # Map the selected display name to a boolean value
        self2.has_header = has_header == 'Yes'

        # Proceed with uploading and showing the matrix
        options = QFileDialog.Options()
        #file_name, _ = QFileDialog.getOpenFileName(self2, 'Open Matrix File', '', 'All Files (*)', options=options)
        file_name = global_variable_relay
        
        if file_name:
            try:
                if self2.has_header:
                    self2.matrix_data = pd.read_csv(file_name, sep=self2.separator, header=0, error_bad_lines=False, warn_bad_lines=True)
                    # Ask the user to select the column containing gene names
                    gene_column, ok = QInputDialog.getItem(self2, 'Select Gene Column', 'Select the column containing gene names:', list(self2.matrix_data.columns), 0, False)
                    if ok:
                        # Rename the selected column to 'ID'
                        self2.matrix_data = self2.matrix_data.rename(columns={gene_column: 'ID'})
                        # Move the 'ID' column to the first position
                        cols = ['ID'] + [col for col in self2.matrix_data.columns if col != 'ID']
                        self2.matrix_data = self2.matrix_data[cols]

                    # Ask the user to select the decimal separator
                    decimal_separator, ok = QInputDialog.getItem(self2, 'Select Decimal Separator', 'Select the decimal separator:', ['.', ','], 0, False)
                    if ok:
                        # Replace the selected decimal separator with a dot (.)
                        self2.matrix_data = self2.matrix_data.applymap(lambda x: str(x).replace(decimal_separator, '.'))

                else:
                    self2.matrix_data = pd.read_csv(file_name, sep=self2.separator, header=None, error_bad_lines=False, warn_bad_lines=True)

                # Update displayed matrix to the entire matrix
                self2.displayed_matrix = self2.matrix_data.copy()

                # Show the matrix
                self2.show_matrix()
            except pd.errors.ParserError:
                QMessageBox.warning(self2, 'Error', 'Failed to parse the CSV file. Please check the separator and try again.')


    def transpose_matrix(self2):
        if self2.displayed_matrix is not None:
            # Transpose the entire matrix
            self2.matrix_data = self2.matrix_data.transpose()

            # Update displayed matrix to the visible portion
            self2.displayed_matrix = self2.matrix_data.iloc[:self2.max_display_rows, :self2.max_display_cols].copy()
            self2.show_matrix()
                    
    def remove_rows(self2):
        if self2.matrix_data is not None:
            row_count = self2.matrix_data.shape[0]
            if row_count > 0:
                from PyQt5.QtWidgets import QInputDialog
                row_to_remove, ok = QInputDialog.getInt(self2, 'Remove Rows', f'Enter the index of the row to remove (1-{row_count}):', min=1, max=row_count)
                if ok:
                    # Apply the modification to the entire matrix
                    self2.matrix_data = self2.matrix_data.drop(self2.matrix_data.index[row_to_remove - 1])

                    # Update displayed matrix to the visible portion
                    self2.displayed_matrix = self2.matrix_data.head(self2.max_display_rows).copy()
                    self2.show_matrix()



    def remove_columns(self2):
        if self2.matrix_data is not None:
            col_count = self2.matrix_data.shape[1]
            if col_count > 0:
                from PyQt5.QtWidgets import QInputDialog
                col_to_remove, ok = QInputDialog.getInt(self2, 'Remove Columns', f'Enter the index of the column to remove (1-{col_count}):', min=1, max=col_count)
                if ok:
                    # Apply the modification to the entire matrix
                    self2.matrix_data = self2.matrix_data.drop(self2.matrix_data.columns[col_to_remove - 1], axis=1)

                    # Update displayed matrix to the visible portion
                    self2.displayed_matrix = self2.matrix_data.iloc[:, :self2.max_display_cols].copy()
                    self2.show_matrix()

    def save_matrix(self2):
        if self2.matrix_data is not None:
            options = QFileDialog.Options()
            file_name, _ = QFileDialog.getSaveFileName(self2, 'Save Matrix File', '', 'Tab-Separated Values (*.tsv);;All Files (*)', options=options)
            if file_name:
                # Ensure the file name has a .tsv extension
                if not file_name.lower().endswith('.tsv'):
                    file_name += '.tsv'

                # Save the matrix to the selected file
                self2.matrix_data.to_csv(file_name, sep='\t', index=False, quoting=0)
                QMessageBox.information(self2, 'Save Successful', 'Matrix saved successfully as: ' + file_name + '\n Please upload the modified matrix from the upload button ')

                self2.close()
                

    def show_matrix(self2):
        if self2.displayed_matrix is not None:
            self2.table_widget.clear()

            num_rows = min(self2.displayed_matrix.shape[0], self2.max_display_rows)
            num_cols = min(self2.displayed_matrix.shape[1], self2.max_display_cols)

            self2.table_widget.setRowCount(num_rows)
            self2.table_widget.setColumnCount(num_cols)
            self2.table_widget.resize(430,300)
            
            # Set column names as headers
            self2.table_widget.setHorizontalHeaderLabels(self2.displayed_matrix.columns.astype(str))

            for row in range(num_rows):
                for col in range(num_cols):
                    from PyQt5.QtWidgets import QTableWidgetItem
                    item = QTableWidgetItem(str(self2.displayed_matrix.iloc[row, col]))
                    self2.table_widget.setItem(row, col, item)


